import React, { FC } from "react";
import "./userprofile.css";

const User: FC = () => {
  return (
    <div className="containerclass">
      <div className="photo">

      </div>
      <div className="details">
        <div className="textdetails">
        <span className="displayname">Displayname</span>
          <span className="firstname">FirstNmae</span>
            <span className="lastname">lastName</span>    
        </div>
        <div className="inboxcontainer">
          <input type="text" placeholder="placeholder" className="textdisplayname"></input>
          <input type="text" placeholder="placeholder"className="textirstname"></input>
          <input type="text" placeholder="placeholder"className="textlastname"></input>   
        </div>
        <div className="youself">
          <input type="text"></input>
        </div>
      </div>
    </div>
  );
};
export default User;
